pub const HEIGHT: i32 = 128;
pub static LIGHTPOS: [f32; 3] = [-0.5f32, 0.5f32, 1.0f32];

pub struct HemanImage<T> {
    pub data: Vec<T>,
    pub width: i32,
    pub height: i32,
}

impl<T: Clone> Clone for HemanImage<T> {
    fn clone(&self) -> Self {
        HemanImage {
            data: self.data.clone(),
            width: self.width,
            height: self.height,
        }
    }
}






pub fn make_planet<T: Clone>(seed: i32, grad: HemanImage<T>) -> HemanImage<T> {
    let mut hmap = heman_generate_planet_heightmap(HEIGHT * 2, HEIGHT, seed);
    let mut albedo = heman_color_apply_gradient(hmap.clone(), -0.5, 0.5, grad);
    let planet = heman_lighting_apply(hmap, albedo, 1, 1, 0.75, LIGHTPOS);
    planet
}

